import React from "react";
import './App.css';
import Header from "./Header";
import Home from "./Home";
import {BrowserRouter as Router,Routes,Route} from "react-router-dom";
import Checkout from "./Checkout";
function App() {
  // BEM
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/checkout"
            element={<Header/>}
            element={<Checkout/>}
          />
          <Route path="/"
            element={<Header/>}
            element={<Checkout/>}
          />
        </Routes>
      </div>
     </Router>
  );
}

export default App;
